import React, { Component } from "react";

class Navigation extends Component {
  render() {
    return (
      <ul>
        <li>
          <a class="active" href="">
            Home
          </a>
        </li>
        <li>
          <a href="">Contact</a>
        </li>
        <li>
          <a href="">Content</a>
        </li>
      </ul>
    );
  }
}
export default Navigation;
